import React from "react";
import { View, Text, Image, StyleSheet, ScrollView } from "react-native";
import NavigationBar from "./NavigationBar";

const yourNewImage = require("./assets/images/background_contactos.jpg");

const PreçosScreen = () => {
  return (
    <View style={styles.container}>
      <NavigationBar title="Formulário" />

      <Image source={yourNewImage} style={styles.topImage} />
      <View style={styles.contentBelowImage}>
        <ScrollView contentContainerStyle={styles.formContainer}>
          {/* Your form content here */}
        </ScrollView>
        <View style={styles.contactInfoContainer}>
          {renderContactInfo("1", "Osteopatia", "A partir de 50 euros por sessão!\nClique para saber mais informações")}
          {renderContactInfo("2", "Treino Livre", "A partir de 40 euros por mês!\nClique para saber mais informações")}
          {renderContactInfo("3", "Treino Personalizado", "A partir de 120 euros por mês!\nClique para saber mais informações")}
          {renderContactInfo("4", "Plano de Nutrição", "A partir de 40 euros por sessão!\nClique para saber mais informações")}
        </View>
      </View>
    </View>
  );
};

const renderContactInfo = (contactNumber, title, content) => {
  return (
    <View style={styles.contactInfo}>
      <Text style={styles.contactTitle}>{title}</Text>
      <Text>{content}</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "white",
  },
  topImage: {
    width: "100%",
    height: 200,
  },
  contentBelowImage: {
    flex: 1,
    marginTop: 10,
  },
  formContainer: {
    paddingHorizontal: "5%",
    marginTop: 10,
  },
  contactInfoContainer: {
    flexDirection: "column",
    paddingHorizontal: "100%",
    justifyContent: "space-evenly",
    flex: 15,
  },
  contactInfo: {
    backgroundColor: "white",
    borderRadius: 16,
    padding: 10,
    width: "60%",
    shadowColor: "#000",
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
  },
  contactTitle: {
    fontSize: "15px",
    fontWeight: "bold",
    marginBottom: 20,
    color: "blue",
  },
});

export default PreçosScreen;
